Chart.defaults.global.defaultFontFamily = '-apple-system,system-ui,BlinkMacSystemFont,"Segoe UI",Roboto,"Helvetica Neue",Arial,sans-serif', Chart.defaults.global.defaultFontColor = "#292b2c";

var vm = this;

var responsedatachar = [];

axios({
    method: 'post',
    url: '/app/reportdashboardchart/',
    data: '',
    xsrfCookieName: 'csrftoken',
    xsrfHeaderName: 'X-CSRFToken',
    headers: {
        'X-Requested-With': 'XMLHttpRequest',
        'Content-Type': 'application/x-www-form-urlencoded; charset=UTF-8'
    },
}).then(function (response) {
    if (response.status === 200 && response.data) {
        response.data.filter((val) => {
            val.create = moment(val.create).format("DD-MM-YYYY");
            console.log(val.create);
            responsedatachar.push(val);
        });

    }
});

console.log(responsedatachar);

